// Gera um PDF com o resultado.
function salvarPDF() {
    // Verifica se os campos estão vazios.
    if (
      resultadoTabela.innerText === "" ||
      resultadoTabela.innerText === "Os campos devem ter o valor de, no mínimo 1(um)!!!"
    ) {
      resultado.innerHTML = `<div class="notification is-danger is-light">Não há dados para geração do PDF.</div>`;
    } else {
      var imgData =
        "data:image/png;base64,";
      var descricao = document.getElementById("descricao").value;
      var docPDF = new jsPDF();
      var data = new Date();
      // docPDF.text('Quanto Cobrar?\nCalculadora de artesanato', 100, 20, 'center');
      docPDF.text(resultadoTabela.innerText, 20, 150);
      docPDF.addImage(imgData, "PNG", 5, 10, 200, 100, "NONE");
      docPDF.setFontSize(10);
      docPDF.text(
        "Gerado em " +
          data.getDate() +
          "/" +
          (data.getMonth() + 1) +
          "/" +
          data.getFullYear() +
          " no Quanto Cobrar? (https://guinuxbr.github.io/QuantoCobrar/)",
        100,
        290,
        "center"
      );
      docPDF.save("QuantoCobrar_" + descricao + ".pdf");
    }
  }